ange from previous quarter in total number of establishments\",\n                \"Total wages paid by reporting establishments in \\\"goods producing\\\" industries\",\n                \"Total number of \\\"goods producing\\\" establishments\",\n                \"Total wages paid by reporting establishments in \\\"services producing\\\" industries\",\n                \"Total wages paid by reporting establishments\",\n                \"Middle of the quarter date\",\n                \"Total number of \\\"services producing\\\" establishments\",\n                \"Data reporting quarter\",\n                \"Change from previous quarter in wages paid by \\\"goods producing\\\" establishments\",\n                \"Total number of establishments\"\n              ],\n            \"columns_format\" :\n              [\n                { \"noCommas\" : \"true\" },\n                {},\n                {\n                  \"precisionStyle\" : \"currency\",\n                  \"precision\" : \"0\",\n                  \"align\" : \"right\"\n                },\n                {},\n                {\n                  \"precisionStyle\" : \"currency\",\n                  \"precision\" : \"0\",\n                  \"align\" : \"right\"\n                },\n                {},\n                {\n                  \"precisionStyle\" : \"currency\",\n                  \"precision\" : \"0\",\n                  \"align\" : \"right\"\n                },\n                {},\n                {\n                  \"precisionStyle\" : \"currency\",\n                  \"noCommas\" : \"false\",\n                  \"precision\" : \"0\",\n                  \"align\" : \"right\"\n                },\n                { \"precisionStyle\" : \"currency\", \"precision\" : \"0\" },\n                {},\n                {},\n                {},\n                {\n                  \"precisionStyle\" : \"currency\",\n                  \"precision\" : \"0\",\n                  \"align\" : \"right\"\