ear-end Report, Line D8) PY 2016-17: 49,636 (RPT019, Open 00-39 as of 6/30/2017) + 24,958 (All closures during the Program Year) PY 2017-18: 50,394 cases open 00-39 as of 6/30/2018 (ad hoc) + 21,940 closures during the Program Year (RSA-911; excludes -1--2 and 00-08 closures) PY 2018-19: 47,425 cases open 00-39 as of 6/30/2019 (ad hoc) + 21,996 closures during the Program Year (RSA-911, validated in ad hoc, excludes -1 to -2 and 00 to 08 closures). PY 2019-20: 36,014 cases open 00-39 as of 6/30/2020 (ad hoc) + 18,535 closures during the Program Year (RSA-911 DE354,  excludes -1 to -2 and 00 to 08 closures). *PY2019 include a period when the Order of Selection was Closed\",\n                \"RSA-911 closures; RSA-911 DE354,  excludes -1 to -2 and 00 to 08 closures\",\n                \"Based on a standard deduction for the year, annual tax brackets and rates established by the IRS, and flat-rate FICA, state, and local taxes.\",\n                \"Estimated federal, state, and local taxes paid plus annualized public support dollars at closure.\",\n                \"Average individual “life of case” cost for all persons having a competitive employment outcome regardless of total number of years receiving services.\",\n                \"Average individual “life of case” cost for all persons having a competitive employment outcome regardless of total number of years receiving services.\",\n                \"\",\n                \"Old Status Code 10 between 7/1 -6/30; distinct PIDS (Case History Report PY2019)\",\n                \"Individuals placed in Competitive Employment divided by the total placements in all employment types.\",\n                \"Time to recover investment in months.\",\n                \"PA average for all occupations (2019): $24.686  RSA standard: \\\"VR consumers served by general/combined agencies who achieved competitive outcomes are earning, on the average, at least 52 cents for every dollar earned hourly by all employed individuals in the s