\n            \"hide_from_data_json\" : false,\n            \"publication_date\" : \"2023-02-08T19:15:06.000Z\"\n          },\n        \"classification\" :\n          {\n            \"categories\" : [ \"economy\", \"social services\", \"finance\" ],\n            \"tags\" : [],\n            \"domain_category\" : \"Employment First\",\n            \"domain_tags\" :\n              [\n                \"employment first\",\n                \"vocational\",\n                \"industry\",\n                \"disability\",\n                \"dli\",\n                \"employment\",\n                \"rehab\",\n                \"ovr\",\n                \"labor\",\n                \"l&i\",\n                \"outcomes\"\n              ],\n            \"domain_metadata\" :\n              [\n                {\n                  \"key\" : \"Data-Management_Business-Owner\",\n                  \"value\" : \"Department of Labor and Industry (DLI)\"\n                },\n                {\n                  \"key\" : \"Data-Management_Update-Frequency\",\n                  \"value\" : \"Annually\"\n                }\n              ]\n          },\n        \"metadata\" :\n          {\n            \"domain\" : \"data.pa.gov\",\n            \"license\" : \"Public Domain U.S. Government\"\n          },\n        \"permalink\" : \"https://data.pa.gov/d/uimv-hpcj\",\n        \"link\" : \"https://data.pa.gov/Employment-First/Employment-First-Annual-OVR-Outcomes-Current-State/uimv-hpcj\",\n        \"owner\" :\n          {\n            \"id\" : \"6jh9-ydjy\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"Jere Matthews\"\n          },\n        \"creator\" :\n          {\n            \"id\" : \"6jh9-ydjy\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"Jere Matthews\"\n          }\n      },\n      {\n        \"resource\" :\n          {\n            \"name\" : \"Vital Signs: Commute Mode Choice (by Place of Residence) – Bay Area\",\n            \"id\" : \"9mau-as85\",\n            \"resource_name\" : null,\n            \"parent_fxf\" : [],\n            \"description\" : \"VITAL SIGNS INDICATOR\\nCommute Mode Choice (T1)\\n\\nFULL MEASURE NAME\\nCommute mode share by residential location\\n\\nLAST UPDATED\\nApril 2020\\n\\nDESCRIPTION\\nCommute mode choice, also known as commute mode share, refers to the mode of transportation that a commuter uses to travel to work, such as driving alone, biking, carpooling or taking transit. The dataset includes metropolitan area, regional, county, city and census tract tables by place of residence.\\n\\nDATA SOURCE\\nU.S. Census Bureau: Decennial Census (1960-2000) - via MTC/ABAG Bay Area Census\\nhttp://www.bayareacensus.ca.gov/transportation/Means19802000.htm\\n\\nU.S. Census Bureau: American Community Survey\\nForm B08301 (2006-2018; place of residence)\\nwww.api.census.gov\\n\\nCONTACT INFORMATION\\nvitalsigns.info@bayareametro.gov\\n\\nMETHODOLOGY NOTES (across all datasets for this indicator)\\nFor the decennial Census datasets, the breakdown of auto commuters between drive alone and carpool is not available before 1980. \\\"Other\\\" includes bicycle, motorcycle, taxi, and other modes of transportation.\\n\\nFor the American Community Survey datasets, 1-year rolling average data was used for metros, region, and county geographic levels, while 5-year rolling average data was used for cities and tracts. This is due to the fact that more localized data is not included in the 1-year dataset across all Bay Area cities. Regional mode shares are population-weighted averages of the nine counties’ modal shares. \\\"Auto\\\" includes drive alone and carpool for the simple data tables and is broken out in the detailed data tables accordingly, as it was not available before 1980. “Transit” includes public operators (Muni, BART, etc.) and employer-provided shuttles (e.g., Google shuttle buses). \\\"Other\\\" includes motorcycle, taxi, and other modes of transportation; bicycle mode share was broken out separately for the first time in the 2006 data and is shown in the detailed data tables. Census tract data is not available for tracts with insufficient numbers of residents or workers.\\n\\nThe metropolitan area comparison was performed for the nine-county San Francisco Bay Area in addition to the primary MSAs for the nine other major metropolitan areas.\",\n            \"attribution\" : \"U.S. Census Bureau\",\n            \"attribution_link\" : \"https://data.census.gov\",\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2020-05-20T21:50:47.000Z\",\n            \"createdAt\" : \"2020-04-09T17:01:10.000Z\",\n            \"metadata_updated_at\" : \"2020-05-20T21:50:47.000Z\",\n            \"data_updated_at\" : \"2020-04-15T20:55:37.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 2,\n                \"page_views_last_month\" : 8,\n                \"page_views_total\" : 475,\n                \"page_views_last_week_log\" : 1.5849625007211563,\n                \"page_views_last_month_log\" : 3.1699250014423126,\n                \"page_views_total_log\" : 8.894817763307945\n              },\n            \"columns_name\" :\n              [ \"Share\", \"Source\", \"Region\", \"Data_Type\", \"Year\", \"Mode\" ],\n            \"columns_field_name\" :\n              [ \"share\", \"source\", \"region\", \"data_type\", \"year\", \"mode\" ],\n            \"columns_datatype\" :\n              [ \"Number\", \"Text\", \"Text\", \"Text\", \"Number\", \"Text\" ],\n            \"columns_description\" : [ \"\", \"\", \"\", \"\", \"\", \"\" ],\n            \"columns_format\" : [ {}, {}, {}, {}, { \"noCommas\" : \"true\" }, {} ],\n            \"download_count\" : 59,\n            \"provenance\" : \"official\",\n            \"lens_view_type\" : \"tabular\",\n            \"lens_display_type\" : \"table\",\n            \"locked\" : false,\n    