istance case denials.\",\n                \"Number corresponding to month. January = 1, December = 12, etc.\",\n                \"Total Public Assistance case denials due to compliance issues related to employment; these include failure to participate as required in Public Assistance  work participation requirements, such as failure to cooperate with establishing employability, failure to attend work program assignments and voluntarily leaving or failing to accept employment without good cause. Sum of Family Assistance and Safety Net Assistance case denials.\",\n                \"Total Public Assistance case denials due to compliance issues other than employment; these include failure to comply with rules other than those related to employment, such as failure to show for eligibility interviews, provide required documentation to verify eligibility or comply with household composition requirements.  Sum of Family Assistance and Safety Net Assistance case denials.\",\n                \"Family Assistance case denials due to financial issues; these include increased earned or unearned income, exceeding resource limits, or other household circumstance changes that make the case financially ineligible.\",\n                \"Family Assistance case denials due to residence issues; these include cases not residing in the jurisdiction of application or where the client cannot be located.\",\n                \"Family Assistance case denials due to compliance issues other than employment; these include failure to comply with rules other than those related to employment, such as failure to show for eligibility interviews, provide required documentation to verify eligibility or comply with household composition requirements.\",\n                \"Safety Net Assistance case denials due to financial issues; these include increased earned or unearned income, exceeding resource limits, or other household circumstance changes that make the case financially ineligible.\",\n                \"Safety Net Assistance case denials due to compliance issues related to employment; these include failure to participate as required in Public Assistance  work participation requirements, such as failure to cooperate with establishing employability, failure to attend work program assignments and voluntarily leaving or failing to accept employment without good cause.\",\n                \"Month data pertains to. Denials are reported on a monthly basis. Day is always the first day of the reference month. The first available month is January 2006.\",\n                \"Contains a code ranging from 01 to 57 and 66,\\ndesignating each of the State’s Local Social\\nServices Districts, which are New York City and\\nthe remaining 57 counties. For the non-New\\nYork City counties, the code refers to the\\nalphabetical order of the district name (e.g.,\\nAlbany=01, Yates = 57). For New York City, the\\ncode is 66.\",\n                \"Text name of each social services district.\",\n                \"Total Public Assistance case denials due to financial issues; these include increased earned or unearned income, exceeding resource limits, or other household circumstance changes that make the case financially ineligible. Sum of Family Assistance and Safety Net Assistance case denials.\",\n                \"Total Public Assistance case denials due to residence issues; these include cases not residing in the jurisdiction of application or where the client cannot be located.  Sum of Family Assistance and Safety Net Assistance case denials.\",\n                \"Family Assistance case denials at the request of the client.\",\n                \"Family Assistance case denials due to compliance issues related to employment; these include failure to participate as required in Public Assistance  work participation requirements, such as failure to cooperate with establishing employability, failure to attend work program assignments and voluntarily leaving or failing to accept employment without good cause.\",\n                \"Family Assistance case denials due to issues not included in the previous categories.\",\n                \"Safety Net Assistance case denials at the request of the client.\",\n                \"Safety Net Assistance case denials due to residence issues; these include cases not residing in the jurisdiction of application or where the client cannot be located.\",\n                \"Safety Net Assistance case denials due to compliance issues other than employment; these include failure to comply with rules other than those related to employment, such as failure to show for eligibility interviews, provide required documentation to verify eligibility or comply with household composition requirements.\",\n                \"Safety Net Assistance case denials due to issues not included in the previous categories.\"\n              ],\n            \"columns_format\" :\n              [\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"false\",\n                  \"align\" : \"center\"\n                },\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"true\",\n                  \"align\" : \"left\"\n                },\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"false\",\n                  \"align\" : \"center\"\n                },\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"false\",\n                  \"align\" : \"center\"\n                },\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"false\",\n                  \"align\" : \"center\"\n                },\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"false\",\n                  \"align\" : \"center\"\n      