ll males statewide at the bottom of this column.\",\n                \"Margin of Error count of all males in this county. \\n\\nA Margin of Error sum at the bottom of this column. \",\n                \"Margin of Error count of females that do not have insurance in this county. \\n\\nMargin of Error sum of  females that do not have insurance at the bottom of this column\",\n                \"Count of uninsured individuals who selected American Indian and Alaska Native race - Margin of Error. The U.S. Census Bureau must adhere to the 1997 Office of Management and Budget (OMB) standards on race and ethnicity which guide the Census Bureau in classifying written responses to the race question: American Indian or Alaska Native – A person having origins in any of the original peoples of North and South America (including Central America) and who maintains tribal affiliation or community attachment. The 1997 OMB standards permit the reporting of more than one race. An individual’s response to the race question is based upon self-identification. An individual’s response to the race question is based upon self-identification. The Census Bureau does not tell individuals which boxes to mark or what heritage to write in. For the first time in Census 2000, individuals were presented with the option to self-identify with more than one race and this continued with the 2010 Census. People who identify with more than one race may choose to provide multiple races in response to the race question. For example, if a respondent identifies as \\\"Asian\\\" and \\\"White,\\\" they may respond to the question on race by checking the appropriate boxes that describe their racial identities and/or writing in these identities on the spaces provided. What is Race? The data on race were derived from answers to the question on race that was asked of individuals in the United States. The Census Bureau collects racial data in accordance with guidelines provided by the U.S. Office of Management and Budget (OMB), and these data are based on self-identification. The racial categories included in the census questionnaire generally reflect a social definition of race recognized in this country and not an attempt to define race biologically, anthropologically, or genetically. In addition, it is recognized that the categories of the race item include racial and national origin or sociocultural groups. People may choose to report more than one race to indicate their racial mixture, such as “American Indian” and “White.” People who identify their origin as Hispanic, Latino, or Spanish may be of any race. OMB requires five minimum categories: White, Black or African American, American Indian or Alaska Native, Asian, and Native Hawaiian or Other Pacific Islander. Reasons for collecting information on race Information on race is required for many Federal programs and is critical in making policy decisions, particularly for civil rights. States use these data to meet legislative redistricting principles. Race data also are used to promote equal employment opportunities and to assess racial disparities in health and environmental risks. Contact Us For assistance, please contact the Census Call Center at 1-800-923-8282 (toll free) or visit ask.census.gov for further information. More info on race - https://www.census.gov/topics/population/race/about/faq.html\",\n                \"Count of individuals who selected Asian as their race - Margin of Error. The U.S. Census Bureau must adhere to the 1997 Office of Management and Budget (OMB) standards on race and ethnicity which guide the Census Bureau in classifying written responses to the race question: Asian – A person having origins in any of the original peoples of the Far East, Southeast Asia, or the Indian subcontinent including, for example, Cambodia, China, India, Japan, Korea, Malaysia, Pakistan, the Philippine Islands, Thailand, and Vietnam. The 1997 OMB standards permit the reporting of more than one race. An individu