 the State association. Each State has its own 2-digit number and each County within the state has its own 3-digit number which are combined into a 5-digit number to uniquely identify every US county. For more technical details : Federal Information Processing Standards Publications (FIPS PUBS) are issued by the National Institute of Standards and Technology (NIST) after approval by the Secretary of Commerce pursuant to Section 111 (d) of the Federal Property and Administrative Services Act of 1949 as amended by the Computer Security Act of 1987, Public Law 100-235. Federal Information Processing Standard (FIPS) 6-4, Counties and Equivalent Entities of the U.S., Its Possessions, and Associated Areas -- 90 Aug 31 , provides the names and codes that represent the counties and other entities treated as equivalent legal and/or statistical subdivisions of the 50 States, the District of Columbia, and the possessions and freely associated areas of the United States. Counties are considered to be the \\\"first-order subdivisions\\\" of each State and statistically equivalent entity, regardless of their local designations (county, parish, borough, etc.). Information gathered from census data -https://www.census.gov/library/reference/code-lists/ansi.html\",\n                \"The FIPS county code is a five-digit Federal Information Processing Standard (FIPS) code (FIPS 6-4) which uniquely identifies counties and county equivalents in the United States, certain U.S. possessions, and certain freely associated states. This is the 3-digit part of the 5-digit county FIPS code specifically standing for the county.\",\n                \"Estimated total population of the County\",\n                \"MOE number for the Population of the demographic area which in this case in the County. \\nA Margin of Error (MOE) is the difference between an estimate and its upper or lower confidence bounds.\\nConfidence bounds are created by adding the MOE to the estimate and subtracting the margin of\\nerror from the estimate. All published SAHIE MOEs are based on a 90 percent confidence level.\",\n                \"Estimated number of uninsured individuals in the County\",\n                \"Margin of error number of uninsured individuals in a county\",\n                \"Percentage of the Uninsured population for each county.\",\n                \"\",\n                \"\",\n                \"Margin of Error - Income of the householder and all other individuals in the household, whether they are related to the householder or not. although the household income statistics cover the calendar year preceding the census, the characteristics of the individuals and the composition of the households are as of the day of the census. (2000, 1990, 1980). The incomes of the household members 15 and older were included. (1970) The incomes of the household members 14 and older were included. Income - (2000) The sum of the amonts reported by repsondents 15 and older for wages, salary, commissions, bonuses, or tips: self-employment incomes from own nonfarm or farm businesses: Interest, dividends, net rental, income, royalty incomes, or income from estates and trust: social security or railroad retirement incomes: Supplemental Security Income: any public assistance or welfare payments: retirement, survivor, or disability pension: and any other sources of income received regularly, such as veterans; payments, unemployment compensation, child support, or alimony. Although the income statistics cover the calendar year preceding the census, the characteristics of individuals are as of the day of the census. The income data collected in the 1990, 1980, 1970 censuses are similar to Census 2000 data, but details of the questions varied. (1970) income data were collected and presented for the population 14 and older. \",\n                \"Income of the householder and all other individuals in the household, whether they are related to the householder or not. although the household i