nce\" : \"official\",\n            \"lens_view_type\" : \"tabular\",\n            \"lens_display_type\" : \"table\",\n            \"locked\" : false,\n            \"blob_mime_type\" : null,\n            \"hide_from_data_json\" : false,\n            \"publication_date\" : \"2024-04-30T17:02:29.000Z\"\n          },\n        \"classification\" :\n          {\n            \"categories\" :\n              [ \"transportation\", \"public safety\", \"infrastructure\" ],\n            \"tags\" : [],\n            \"domain_category\" : \"Government\",\n            \"domain_tags\" :\n              [\n                \"citation\",\n                \"city services & operations\",\n                \"code\",\n                \"date\",\n                \"fine\",\n                \"license plate\",\n                \"make\",\n                \"model\",\n                \"parking\",\n                \"status\",\n                \"street\",\n                \"vehicle\"\n              ],\n            \"domain_metadata\" : []\n          },\n        \"metadata\" : { \"domain\" : \"data.norfolk.gov\" },\n        \"permalink\" : \"https://data.norfolk.gov/d/ei2q-6g8n\",\n        \"link\" : \"https://data.norfolk.gov/Government/Parking-Citations/ei2q-6g8n\",\n        \"owner\" :\n          {\n            \"id\" : \"q847-u5c9\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"City of Norfolk\"\n          },\n        \"creator\" :\n          {\n            \"id\" : \"q847-u5c9\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"City of Norfolk\"\n          }\n      },\n      {\n        \"resource\" :\n          {\n            \"name\" : \"Daily Mobility Statistics\",\n            \"id\" : \"w96p-f2qv\",\n            \"resource_name\" : null,\n            \"parent_fxf\" : [],\n            \"description\" : \"The Daily Mobility Statistics were derived from a data panel constructed from several mobile data providers, a step taken to address the reduce the risks of geographic and temporal sample bias that would result from using a single data source. In turn, the merged data panel only included data from those mobile devices whose anonymized location data met a set of data quality standards, e.g., temporal frequency and spatial accuracy of anonymized location point observations, device-level temporal coverage and representativeness, spatial distribution of data at the sample and county levels. After this filtering, final mobility estimate statistics were computed using a multi-level weighting method that employed both device- and trip-level weights, thus expanding the sample represented by the devices in the data panel to the at-large populations of each state and county in the US.\\n\\nData analysis was conducted at the aggregate national, state, and county levels.  To assure confidentiality and support data quality, no data were reported for a county if it had fewer than 50 devices in the sample on any given day.\\n\\nTrips were defined as movements that included a stay of longer than 10 minutes at an anonymized location away from home. A movement with multiple stays of longer than 10 minutes--before returning home--was counted as multiple trips.\\n\\nThe Daily Mobility Statistics data on this page, which cover the COVID and Post-COVID periods, are experimental.  Experimental data products are created using novel or exploratory data sources or methodologies that benefit data users in the absence of other statistically rigorous products, and they not meet all BTS data quality standards.\",\n            \"attribution\" : \"Maryland Transportation Institute and Center for Advanced Transportation Technology Laboratory at the University of Maryland\",\n            \"attribution_link\" : \"https://mti.umd.edu/\",\n            \"contact_email\" : \"kyle.titlow@dot.gov\",\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2025-03-14T21:04:59.000Z\",\n            \"createdAt\" : \"2020-05-19T20:00:02.000Z\",\n            \"metadata_updated_at\" : \"2025-03-14T21:04:59.000Z\",\n            \"data_updated_at\" : \"2024-04-30T19:08:37.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 223,\n                \"page_views_last_month\" : 1532,\n                \"page_views_total\" : 88512,\n                \"page_views_last_week_log\" : 7.807354922057604,\n                \"page_views_last_month_log\" : 10.582141981658777,\n                \"page_views_total_log\" : 16.43360174048721\n              },\n            \"columns_name\" :\n              [\n                \"Number of Trips 100-250\",\n                \"Date\",\n                \"Number of Trips 10-25\",\n                \"Number of Trips 50-100\",\n                \"Month\",\n                \"County FIPS\",\n                \"County Name\",\n                \"Number of Trips 3-5\",\n                \"Number of Trips >=500\",\n                \"State Postal Code\",\n                \"Population Staying at Home\",\n                \"Number of Trips <1\",\n                \"Number of Trips 1-3\",\n                \"Number of Trips 25-50\",\n                \"State FIPS\",\n                \"Population Not Staying at Home\",\n                \"Number of Trips\",\n                \"Row ID\",\n                \"Week\",\n                \"Geographic Level\",\n                \"Number of Trips 250-500\",\n                \"Number of Trips 5-10\"\n              ],\n            \"columns_field_name\" :\n              [\n                \"trips_100_250\",\n                \"date\",\n                \"trips_10_25\",\n                \"trips_50_100\",\n                \"month\",\n                \"county_fips\",\n                \"county\",\n                \"trips_3_5\",\n                \"trips_500\",\n                \"state_code\",\n                \"pop_stay_at_home\",\n                \"trips_1\",\n                \"trips_1_3\",\n                \"trips_25_50\",\n                \"state_fips\",\n                \"pop_not_stay_at_home\",\n                \"trips\",\n                \"row_id\",\n                \"week\",\n                \"level\",\n                \"trips_250_500\",\n                \"trips_5_10\"\n              ],\n            \"columns_datatype\" :\n              [\n                \"Number\",\n                \"Calendar date\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Number\",\n                \"Text\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Text\",\n                \"Number\",\n                \"Number\",\n                \"Text\",\n                \"Number\",\n                \"Text\",\n                \"Number\",\n                \"Number\"\n              ],\n            \"columns_description\" :\n              [\n                \"Number of trips by residents greater than 100 miles and shorter than 250 miles (100 ≤ trip distance < 250 miles)\",\n                \"Date\",\n                \"Number of trips by residents greater than 10 miles and shorter than 25 miles (10 ≤ trip distance < 25 miles)\",\n                \"Number of trips by residents greater than 50 miles and shorter than 100 miles (50 ≤ trip distance < 100 miles)\",\n                \"\",\n                \"Five-digit FIPS county code\",\n                \"County name\",\n                \"Number of trips by residents greater than 3 miles and shorter than 5 miles (3 ≤ trip distance < 5 miles)\",\n                \"Number of trips by residents greater than 500 miles (trip distance ≥ 500 miles)\",\n                \"State postal code\",\n                \"Number of residents staying at home, i.e., persons who make no trips with a trip end more than one mile away from home\",\n              